from sympy import factorint, isprime
def ok(n):
    f = factorint(n)
    w, W = len(f), sum(e for e in f.values())
    return w > 3 and W > 3 and not isprime(w) and not isprime(W)
print([k for k in range(1, 2000) if ok(k)]) # _Michael S. Branicky_, Feb 07 2025

